          <Row type="flex" justify="center" align="middle">
            <Row>
              <Col>
                <h1 style={{ fontFamily: "Poppins" }}>DL 1961</h1>
              </Col>
            </Row>
          </Row>
        </div>
      </>
    );
  }
}
